		<script type="text/javascript">
			/**
			 * Returns the string representation of the number. 
			 * @param pValue {Float} The number to process.
			 * @return {String} The string representation (example: 12856892.11111 => 12,856,892.11).
			 */
		    var numberDisplay = function( pValue ){
		    	var new_val = "" ;
		    	if( ("" + pValue + "").indexOf(".") != -1 ){
		    		new_val = pValue.toFixed(2).replace(/(\d)(?=(\d{3})+\b)/g, '$1,');
		    	} else {
		    		new_val = pValue.toFixed().replace(/(\d)(?=(\d{3})+\b)/g, '$1,');
		    	}
		        return new_val ;
		    }
		    
			/**
			 * Add listener to update content of sunburst-modal.
			 */
			var add_sunburst_listeners = function() {
				$('#sunburst-modal').on('shown.bs.modal', function (event) { // Draw sunburst when modal is shown
					// Clean previous chart
					$('#sunburst-graph').empty() ;
					$('#sunburst-walktrace').empty() ;
					$('#sunburst-menu').empty() ;
					$('#sunburst-detail').empty() ;

					// Select data
					var tree = ExtendedNode.fromNewick( tree_distribution );
					if( event.relatedTarget.id == "display-spl-sunburst" ){
						var selected_samples = new Array();
						$('input[id^="taxBySample-chk-"]').each( function(){
							if( $(this).is(':checked')){
								var sample_name = $(this).prop('id').substring(16, $(this).prop('id').length) ;
								selected_samples.push( samples_names.indexOf(sample_name) );
							}
						});
						tree.keepOnlySamples( selected_samples );
					}
					// Draw chart
					cJDistrib( 
						tree.toJson(),
						{
							"pg_selector": {
								"sunburst": "#sunburst-graph",
								"walktrace": "#sunburst-walktrace",
								"menu": "#sunburst-menu",
								"detail": "#sunburst-detail"
							},
							"graph": {
								"sunburst": {
									"width": Math.min($("#sunburst-graph").width(), $(window).height()),
									"height": Math.min($("#sunburst-graph").width(), $(window).height()),
								},
								"colors": {
									"start_depth": 2
								}
							},
						}
					);

					// Center sunburst
					$("#sunburst-graph").width( Math.min($("#sunburst-graph").width(), $(window).height()) );
				});
			}

			var updateTaxButtonState = function(){
				//$("#display-rarefaction").removeClass( "disabled" );
				//$("#display-spl-sunburst").removeClass( "disabled" );
				$("#display-spl-sunburst").prop('disabled', false);
				if( $('input[id^="taxBySample-chk-"]:checked').length == 0 ){
					$("#display-spl-sunburst").prop( "disabled" ,true );
				}
			}
			
			/**
			 * Loads content of "taxonomy distribution" nav.
			 * @param cotainer_id {String} The ID of the content where the information will be added.
			 */
			var taxBySample_load = function( container_id ) {
				// Table titles
				//var titles = [ '<input id="taxBySample-check-all" type="checkbox" value="1">', "Samples" ];
				var titles = ['<label class="container"><input type="checkbox" id="taxBySample-check-all" value="1"><span class="checkmark"></span></label>','Samples'];
				titles.push( "Nb " + taxonomic_ranks[taxonomic_ranks.length-1].toLowerCase() + " retrieved");
				$('#taxBySample-table thead').append( '<tr><th>' + titles.join("</th><th>") + '</th></tr>' );
				$('#taxBySample-table .title').attr( "colspan", titles.length );
				$('#taxBySample-table tfoot th').each(function(){
					$(this).attr( "colspan", titles.length );
				});
				
				// Table data
				for( var sample_idx = 0 ; sample_idx < samples_names.length ; sample_idx++ ){
					var sample_name = samples_names[sample_idx] ;
					var tree = ExtendedNode.fromNewick( tree_distribution );
					tree.keepOnlySamples( [sample_idx] );
					//var sample_data = [ '<input id="taxBySample-chk-' + sample_name + '" type="checkbox" value="1">', sample_name ];
					var sample_data = ['<label class="container"><input type="checkbox" id="taxBySample-chk-' + sample_name + '" value="1"><span class="checkmark"></span></label>',sample_name];

					var last_rank = taxonomic_ranks.length;
					sample_data.push( numberDisplay(tree.getNodeByDepth(last_rank).length) );
					// Add row data
					$('#taxBySample-table tbody').append( '<tr><td>' + sample_data.join("</td><td>") + '</td></tr>' );
				}
				
				// Buttons enable/disable management
				$('input[id^="taxBySample-check-all"]').on( 'change', updateTaxButtonState );
				$('input[id^="taxBySample-chk-"]').on( 'change', updateTaxButtonState );
				
				// Check all management
				$('#taxBySample-check-all').on('click', function (e) { // Manage check all
					if( $(this).is(':checked') ){
						$('input[id^="taxBySample-chk-"]').each( function(){
							$(this).prop( 'checked', true );
						});
					} else {
						$('input[id^="taxBySample-chk-"]').each( function(){
							$(this).prop( 'checked', false );
						});
					}
				});
				$('input[id^="taxBySample-chk-"]').on('change', function (e) { // Uncheck select all when uncheck one sample
					if( !$(this).is(':checked') && $('#taxBySample-check-all').is(':checked') ){
						$('#taxBySample-check-all').prop( 'checked', false );
					}
				});
				
				// Datatable
				$('#taxBySample-table').DataTable({
					//"sDom": '<"top"<"#taxBySample-csv-export"><"clear">lf>rt<"bottom"ip><"clear">',
					dom: 	"<'#taxBySample-csv-export'><'row'<'col-sm-5'l><'col-sm-7'f>>" +
							"<'row'<'col-sm-12'tr>>" +
							"<'row'<'col-sm-5'i><'col-sm-7'p>>",
					'order': [[1, 'asc']],
					'lengthMenu': [[10, 25, 50, 100, -1], [10, 25, 50, 100, "All"]],
					'columnDefs': [{
						'targets': [0],
						'orderable': false
					}],
					"fnDrawCallback": updateTaxButtonState
				});
				// Datatable export
